// fancybox
window.fancybox_settings = {
	smallBtn: false,
	toolbar: "auto",
	buttons: [
		"close"
	],
	arrows: true,
	touch: true,
	loop: true,
	autoFocus: false,
	animationEffect : "zoom-in-out",
	transitionEffect : "slide",
	idleTime: false,
	helpers: { 
		overlay : {
			closeClick: true
		}
	},
	touch: {
		vertical: true,
		momentum: true
	},
};

$.extend($.fancybox.defaults, fancybox_settings);

// transform imgs with the class svg in inline svgs
function replaceSvg() {
	jQuery('img.svg').each(function(){
		var $img = jQuery(this);
		var imgID = $img.attr('id');
		var imgClass = $img.attr('class');
		var imgURL = $img.attr('src');
		jQuery.get(imgURL, function(data) {
			var $svg = jQuery(data).find('svg');
			if(typeof imgID !== 'undefined') {
				$svg = $svg.attr('id', imgID);
			}
			if(typeof imgClass !== 'undefined') {
				$svg = $svg.attr('class', imgClass+' replaced-svg');
			}
			$svg = $svg.removeAttr('xmlns:a');
			$img.replaceWith($svg);
		}, 'xml');
	});
};

// smooth scroll
$(".sliding-link").click(function(e) {
	e.preventDefault();
	var aid = $(this).attr("href");
	$('html,body').animate({scrollTop: $(aid).offset().top},'slow');
});

// correct label click
$('label').click(function(e){
	e.stopImmediatePropagation();
});

// fs menu
$('#open-fs').click(function(){
	$('body').addClass('menu-open');
});

$('#close-fs, #fs-menu li a').click(function(){
	$('body').removeClass('menu-open');
});

// doc ready functions
$(document).ready(function() {
	
	// replace imgs to svgs
	replaceSvg()
	setTimeout(function(){ replaceSvg(); }, 200)
	setTimeout(function(){ replaceSvg(); }, 1000)
	setTimeout(function(){ replaceSvg(); }, 3000)
	
});